  <style>
            #field
      {
          position:relative;
          left: 0px;
          top:0px;
          width:710px;
          height:1240px;
          border-style:dashed;
          border-color: #ff8c00;
          overflow: hidden;
    

      }
      #scene
      {
          position:absolute;
          left: 0px;
          top:0px;
          

      }
      #chat
      {
          position:absolute;
          left:0px;
          top:0px;
          animation: 5s chat;

      }
            #max
      {
        position:absolute;
top:748px;
left:152px;
animation: .5s turnhead linear alternate infinite;
      }
      #music
      {
        position:absolute;
top:730px;
left:132px;
animation: .5s turnnotes linear alternate infinite;
      }
      #window
      {
        position:absolute;
top:815px;
left:137px;
      }
      #bigCac
      {
        position:absolute;
top:803px;
left:40px;
animation: 4s moveright linear infinite;
      }
      #smallishCac
      {
        position:absolute;
top:603px;
left:-800px;
animation: 4s moveright2 linear infinite 1s;
      }
      #smallRock
      {
        position:absolute;
top:1129px;
left:-500px;
animation: 4s moveright2 linear infinite 1s;
      }
      #bigRock
      {
        position:absolute;
top:1023px;
left:-100px;
animation: 4s moveright linear infinite
      }
      #smallCac
      {
        position:absolute;
top:1010px;
left:-400px;
animation: 4s moveright linear infinite ;
      }
      #mirror
      {
        position:absolute;
top:348px;
left:65px;
      }
      #ftire
      {
        position:absolute;
top:895px;
left:67px;
animation: 2s turn linear infinite;
      }
      #rtire
      {
position:absolute;
top:895px;
left:445px;
transform-origin:center;
animation: 2s turn linear infinite;
      }
      @keyframes chat{
          0%{
            opacity: 0;
          }
          50%{
            opacity: 0;
          }
          100%
          {
            opacity: 1;
          }
      }
      @keyframes turn{
          0%{
            transform: rotate(0deg)
          }
          100%
          {
              transform: rotate(-360deg)
          }
      }
      @keyframes moveright{
          0%{
            transform: translateX(-100px)
          }
          100%
          {
            transform: translateX(1600px)
          }
      }
      @keyframes moveright2{
          0%{
            transform: translateX(-100px)
          }
          100%
          {
            transform: translateX(2100px)
          }
      }
      @keyframes turnhead{
          0%{
            transform: rotate(0deg) scale(1);
            
          }
          100%
          {
              transform: rotate(-10deg) scale(.98);
              
          }
      }
      @keyframes turnnotes{
          0%{
            transform: rotate(-5deg)
          }
          100%
          {
              transform: rotate(5deg)
          }
      }
    </style>
